import React, {Component} from 'react';
import {Button} from "react-bootstrap";

class LoginComponent extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <h3>Login Component</h3>
                <Button>Login</Button>
            </div>
        );
    }
}

export default LoginComponent;
